/*Table structure for table `erp_purchase` */

DROP TABLE IF EXISTS `erp_purchase`;

CREATE TABLE `erp_purchase` (
  `id` mediumint(12) unsigned NOT NULL AUTO_INCREMENT,
  `order_no` varchar(100) NOT NULL DEFAULT '' COMMENT '进货单号',
  `compact_no` varchar(100) NOT NULL DEFAULT '' COMMENT '合同编号',
  `supplier` int(11) NOT NULL DEFAULT '0' COMMENT '供应商',
  `remark` varchar(1000) NOT NULL DEFAULT '' COMMENT '备注',
  `user_id` smallint(11) NOT NULL DEFAULT '0' COMMENT '创建用户',
  `buy_type` varchar(100) NOT NULL DEFAULT '' COMMENT '采购方式',
  `total_num` int(11) NOT NULL DEFAULT '0' COMMENT '采购总数',
  `total_money` decimal(11,2) NOT NULL DEFAULT '0.00' COMMENT '进货总价',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '审核状态 ',
  `bills_status` varchar(100) NOT NULL DEFAULT '' COMMENT '单据状态',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `order_time` int(11) NOT NULL DEFAULT '0' COMMENT '订单时间',
  `check_time` int(11) NOT NULL COMMENT '审核时间',
  `update_time` int(11) DEFAULT NULL,
  `check_uid` int(11) DEFAULT NULL COMMENT '审核人',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='进货表';

