/*Table structure for table `erp_purchase_goods` */

DROP TABLE IF EXISTS `erp_purchase_goods`;

CREATE TABLE `erp_purchase_goods` (
  `id` mediumint(12) unsigned NOT NULL AUTO_INCREMENT,
  `no` varchar(100) NOT NULL DEFAULT '' COMMENT '代码',
  `name` varchar(100) NOT NULL DEFAULT '' COMMENT '规格名',
  `type` varchar(50) NOT NULL DEFAULT '' COMMENT '类别',
  `num` smallint(11) unsigned DEFAULT NULL COMMENT '数量',
  `unit` varchar(50) NOT NULL DEFAULT '' COMMENT '单位',
  `pid` int(11) NOT NULL COMMENT '采购单号',
  `unit_price` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '单价价格',
  `tax_price` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '含税单价',
  `price` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '单价',
  `rate` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '税率',
  `rate_price` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '税额',
  `total_price` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '合计金额',
